window.bookSummaryJSON = "<p>In <i>Children of the Jedi</i>, Barbara Hambly introduces a new character: Callista, a brave Jedi warrior of long ago who gave her life to foil one of the Empire's darkest plans, a plot to destroy a stronghold that was a sanctuary for the families of Jedi knights. </p> <p>The plot involved a dreadnaught, one of the Empire's most devious inventions, governed by a sophisticated artificial intelligence. Crippled during the war against the Empire, the vessel has drifted through space for years. But now it is slowly reactivating and resuming its inexorable mission. Only Luke Skywalker can feel its evil presence as well as the mysterious influence of that powerful woman who should have died decades ago.</p>"; 
